import styled from "styled-components";

const MenuItems = styled.div`
  .bg-pwhite;
  width: 100vw;
  height: 100vh;
  overflow-y: scroll;
  .fixed;
  .top-0;
  .left-0;
  .text-pdark;
  .flex;
  .flex-col;
  .justify-around;
  .items-center;
  font-size: 18px;
  font-weight: 700;
`;

const Close = styled.div`
    .fixed;
    .top-0;
    .right-0;
    .p-8;
`;

const Menu = styled.div``;

const SideMenu = () => {
  return (
    <MenuItems>
        <Close>X</Close>
      <Menu>About</Menu>
      <Menu>Talks</Menu>
      <Menu>Blogs</Menu>
      <Menu>Videos</Menu>
      <Menu>Projects</Menu>
      <Menu>Get in Touch</Menu>
    </MenuItems>
  );
};

export default SideMenu;
